state = store.getState();


class App extends React.Component {
	

	render() {
		let state = store.getState();
		//let page_now = state.page_now;

		return (
			<div>
				<Header />
				<br />
				<LoadedShop />
				<br />
				<LoadedCoupon />
				<br />
				<LoadedContent />
				
			</div>
		)
	}
}









//export default App
export default connect()(App)
